import Colors from '../constants/colors';


export default class index extends React.Component {

    static async getInitialProps() {
        return {}
    }

    render() {
        return (
            <div>
                <div className="mainContainer">
                    <div className="navBar">

                    </div>
                </div>
                <style jsx>
                    {`
                        .mainContainer{
                            height: 200vh;
                            width: 100%;
                            background: ${Colors.lightGrey};
                        }
                        .navBar{
                            height: 72px;
                            width: 100%;
                            background: white;
                            
                        }
                  `}
                </style>

                <style global jsx>
                    {`
                        * {
                            background: ${Colors.middleShade};
                            margin: 0;
                            padding: 0;
                            border: 0;
                        }
                       
                    `}
                </style>

            </div>
        )

    }



}
